import from '../../pictures/.png'; */

class Skills extends Component {
  render() {
    return (
      <div>

        <p>Front-end et </p>

        <img src={css} alt="logo" style={{ width: '5vh'}} />
        <img src={less} alt="logo" style={{ width: '5vh'}} />
        <img src={sass} alt="logo" style={{ width: '5vh'}} />
