        <p>Environnement de travail</p>
        <img src={linux} alt="logo" style={{ width: '5vh'}} />
        <img src={github} alt="logo" style={{ width: '5vh'}} />
        <img src={trello} alt="logo" style={{ width: '5vh'}} />
        <img src={vscode} alt="logo" style={{ width: '5vh'}} />
        <p>Back-end</p>
     {/*    <img src={} alt="logo" />
        <img src={} alt="logo" /> */}
      </div>
    );
  }
}

